import {CHANGE_HEADER_DATA} from '../actions/actionsType';
const initialState={
        roomName: "My chat",
        numberUsers: 0,
        numberMessages: 0,
        lastMessageDate: "0",
};

export function headerReducer(state=initialState,action){
    switch (action.type) {
        case CHANGE_HEADER_DATA:
            return state;

        default:
            return state;
    }
}
